import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Toggle from './Toggle';
import ContactsList from './ContactsList'

let contacts = [{
    name: 'Scott',
    phone: '555 333 5555'
}, {
    name: 'Courtney',
    phone: '555 111 5555'
}, {
    name: 'Scott',
    phone: '555 555 5555'
}, {
    name: 'Scott',
    phone: '555 555 5555'
}]

class App extends Component {

  render() {
    return (
      <div className="App">
        <header className="App-header">
            <h1>Contacts List</h1>
            <ContactsList contacts={contacts}/>
        </header>
      </div>
    );
  }
}

export default App;
